adText:
Unik lägenhet om 4rok i parvilla. Gamla disponentvillan vid G:a Tobak. El ingår i hyran . Div. skötsel ansvarar hg för. Balkong finns. 
Missa inte chansen att bli nästa hyresgäst i denna lägenhet. 
@bostadsregistret # bostadsregistret

Trevlig lägenhet om 1rok mitt i centrala Nässjö. Lägenheten är belägen på andra våningen och har balkong. Hiss finns. 
Här bor du med närhet till allt som staden har att erbjuda. Välkommen med din ansökan. 
@bostadsregistret #bostadsregistret

Nyrenoverad Stor Lägenhet om 3rok i Nässjö. 
Nyrenoverad bottenvåning med öppen spis i vardagsrummet i en stor villa med ca 950m2 trädgård. Stor balkong med tak. Finns diskmaskin, tvättmaskin, torktumlare. 1 parkeringsplats ingår. Ca 5 minuter ifrån centrum med bil.
@bostadsregistret #bostadsregistret
